void DStortiumAudioProcessorEditor::sliderValueChanged (Slider* sliderThatWasMoved)
{
    //[UsersliderValueChanged_Pre]
	DStortiumAudioProcessor* ourProcessor = getProcessor();
    //[/UsersliderValueChanged_Pre]

    if (sliderThatWasMoved == gainSlider)
    {
        //[UserSliderCode_gainSlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::Gain, (float)gainSlider->getValue());
        //[/UserSliderCode_gainSlider]
    }
    else if (sliderThatWasMoved == symmetrySlider)
    {
        //[UserSliderCode_symmetrySlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::Symmetry, (float)symmetrySlider->getValue());
        //[/UserSliderCode_symmetrySlider]
    }
    else if (sliderThatWasMoved == driveSlider)
    {
        //[UserSliderCode_driveSlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::Drive, (float)driveSlider->getValue());
        //[/UserSliderCode_driveSlider]
    }
    else if (sliderThatWasMoved == hpfSlider)
    {
        //[UserSliderCode_hpfSlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::HPF, (float)hpfSlider->getValue());

        //[/UserSliderCode_hpfSlider]
    }
    else if (sliderThatWasMoved == mixSlider)
    {
        //[UserSliderCode_mixSlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::Mix, (float)mixSlider->getValue());
        //[/UserSliderCode_mixSlider]
    }
    else if (sliderThatWasMoved == lowPassSlider)
    {
        //[UserSliderCode_lowPassSlider] -- add your slider handling code here..
		ourProcessor->setParameter(DStortiumAudioProcessor::LPF, (float)lowPassSlider->getValue());
        //[/UserSliderCode_lowPassSlider]
    }

    //[UsersliderValueChanged_Post]
    //[/UsersliderValueChanged_Post]
}



//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void DStortiumAudioProcessorEditor::timerCallback() {
	DStortiumAudioProcessor* ourProcessor = getProcessor();
	//exchange any data you want between UI elements and the Plugin "ourProcessor"
	if(ourProcessor->NeedsUIUpdate())
	{
		hpfSlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::HPF), dontSendNotification);
		driveSlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::Drive), dontSendNotification);
		symmetrySlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::Symmetry), dontSendNotification);
		mixSlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::Mix), dontSendNotification);
		lowPassSlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::LPF), dontSendNotification);
		gainSlider->setValue(ourProcessor->getParameter(DStortiumAudioProcessor::Gain), dontSendNotification);
		ourProcessor->ClearUIUpdateFlag();
	}
}
